import React from "react";
import { Link } from "react-router-dom";
import homeIcon from "../assets/icons/home-icon.svg";
import favoritesIcon from "../assets/icons/star-icon.svg";
import profileIcon from "../assets/icons/profile-icon.svg";

const Sidebar = () => {
    return (
        <div className="sidebar" style={{ border: "2px solid red", height: "100vh", width: "250px", backgroundColor: "#f8f9fa" }}>
            <div className="p-3">
                <h4>Mi aplicaci√≥n</h4>
            </div>
            <nav className="nav flex-column">
                <Link to="/" className="nav-link">
                    <img src={homeIcon} alt="Inicio" className="icon" />
                    Inicio
                </Link>
                <Link to="/favorites" className="nav-link">
                    <img src={favoritesIcon} alt="Favoritos" className="icon" />
                    Favoritos
                </Link>
                <Link to="/profile" className="nav-link">
                    <img src={profileIcon} alt="Perfil" className="icon" />
                    Perfil
                </Link>
            </nav>
        </div>
    );
};

export default Sidebar;
